import dataPL from "./plData"

var dataML = [
    {
        val: 30,id: '0-0',level:0,index:0,prevIndex:undefined,name:'NLP',
        color:'#a6cee3',
        children:
            [
                {val:0.3,id:'1-1',level:1,index:1,prevIndex:0,name:'MultiClass Classification',color:'#a6Dee3'},
                {val:0.25,id:'1-2',level:1,index:2,prevIndex:0,name:'Sentiment Analysis',color:'#a6Dee3'},
                {val:0.25, id:'1-3',level:1,index:3,prevIndex:0,name:'Topic Modeling',color:'#a6Dee3'},
                {val:0.1, id:'1-4',level:1,index:4,prevIndex:0,name:'NER',color:'#a6Dee3'},
                {val:0.1, id:'1-5',level:1,index:5,prevIndex:0,name:'Extractive Summarization'},
            ]
    },
    {   
        val: 0.30,id:'0-1',level:0, index:1,prevIndex:undefined,name:'RecSys',
        color:'#a6cFe3',
        children:
        [
            {val:0.5,id:'1-1',level:1,index:1,prevIndex:0,name:'Content-based filtering'},
            {val:0.5,id:'1-1',level:1,index:1,prevIndex:0,name:'Collaborative filtering'},
        ]
        },
    {val: 0.25, id: '0-2', level:0, index:2, prevIndex: undefined, name:'FrameWorks',color:'#a6Dee3'},
    {val: 0.15, id: '0-3', level:0, index:3, prevIndex: undefined, name:'Other',color:'#F6cee3'},
]

var dataML = {
    mainData: [
        {
            name:'NLP',
            y:30,
            drilldown:'NLP'
        }
    ]
}

export default dataML;
